"use strict";(self.webpackChunkifs_shanghai_doc=self.webpackChunkifs_shanghai_doc||[]).push([[116],{3214:(t,e,d)=>{d.r(e),d.d(e,{data:()=>r});const r={key:"v-756ea932",path:"/zh/eb_xelor/user_guide/diagnostic.html",title:"Diagnostic",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:2,title:"Overview",slug:"overview",children:[]},{level:2,title:"Diagnostic services",slug:"diagnostic-services",children:[{level:3,title:"DiagnosticSessionControl (0x10)",slug:"diagnosticsessioncontrol-0x10",children:[]},{level:3,title:"EcuReset (0x11)",slug:"ecureset-0x11",children:[]},{level:3,title:"SecurityAccess (0x27)",slug:"securityaccess-0x27",children:[]},{level:3,title:"CommunicationControl (0x28)",slug:"communicationcontrol-0x28",children:[]},{level:3,title:"TesterPresent (0x3E)",slug:"testerpresent-0x3e",children:[]},{level:3,title:"ControlDTCSetting (0x85)",slug:"controldtcsetting-0x85",children:[]},{level:3,title:"ResponseOnEvent (0x86)",slug:"responseonevent-0x86",children:[]},{level:3,title:"ReadDataByIdentifier (0x22)",slug:"readdatabyidentifier-0x22",children:[]},{level:3,title:"WriteDataByIdentifier (0x2E)",slug:"writedatabyidentifier-0x2e",children:[]},{level:3,title:"ClearDiagnosticInformation (0x14)",slug:"cleardiagnosticinformation-0x14",children:[]},{level:3,title:"ReadDTCInformation (0x19)",slug:"readdtcinformation-0x19",children:[]},{level:3,title:"RoutineControl (0x31)",slug:"routinecontrol-0x31",children:[]}]}],filePathRelative:"zh/eb_xelor/user_guide/diagnostic.md",git:{updatedTime:1633094711e3,contributors:[{name:"Qian Chen",email:"827391449@qq.com",commits:1}]}}},706:(t,e,d)=>{d.r(e),d.d(e,{default:()=>i});const r=(0,d(6252).uE)('<h1 id="diagnostic" tabindex="-1"><a class="header-anchor" href="#diagnostic" aria-hidden="true">#</a> Diagnostic</h1><p>EB xelor HPC reference integrates the diagnostic over IP on RT_RefApp with services configuration.</p><h2 id="overview" tabindex="-1"><a class="header-anchor" href="#overview" aria-hidden="true">#</a> Overview</h2><p>DoIp according to ISO13400-2:2011 is implemented. One tester with address 0x00EF8 for IPv4 and 0x00EF9 for IPv6 is supported. Physical addressing is supported on target address 0x1148 and functional addressing on 0xEEF8.</p><h2 id="diagnostic-services" tabindex="-1"><a class="header-anchor" href="#diagnostic-services" aria-hidden="true">#</a> Diagnostic services</h2><p>The following services are supported:</p><ul><li>DiagnosticSessionControl (0x10)</li><li>EcuReset (0x11)</li><li>SecurityAccess (0x27)</li><li>CommunicationControl (0x28)</li><li>TesterPresent (0x3E)</li><li>ControlDTCSetting (0x85)</li><li>ResponseOnEvent (0x86)</li><li>ReadDataByIdentifier (0x22)</li><li>WriteDataByIdentifier (0x2E)</li><li>ClearDiagnosticInformation (0x14)</li><li>ReadDTCInformation (0x19)</li><li>RoutineControl (0x31)</li></ul><p>image:82E43D9D-4A27-4b12-9A39-8A042C0EA74F.png[Architecture,scaledwidth=&quot;75%&quot;]</p><h3 id="diagnosticsessioncontrol-0x10" tabindex="-1"><a class="header-anchor" href="#diagnosticsessioncontrol-0x10" aria-hidden="true">#</a> DiagnosticSessionControl (0x10)</h3><p>RT_RefApp supports DiagnosticSessionControl (0x10). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>Default</td><td>0x01</td><td>Tbd</td><td>Default, Programming, Extended</td></tr><tr><td>Programming</td><td>0x02</td><td>Tbd</td><td>Default, Programming, Extended</td></tr><tr><td>Extended</td><td>0x03</td><td>Tbd</td><td>Default, Programming, Extended</td></tr></tbody></table><h3 id="ecureset-0x11" tabindex="-1"><a class="header-anchor" href="#ecureset-0x11" aria-hidden="true">#</a> EcuReset (0x11)</h3><p>RT_RefApp supports EcuReset (0x11). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>hardReset</td><td>0x01</td><td>Tbd</td><td>Default, Programming, Extended</td></tr></tbody></table><h3 id="securityaccess-0x27" tabindex="-1"><a class="header-anchor" href="#securityaccess-0x27" aria-hidden="true">#</a> SecurityAccess (0x27)</h3><p>RT_RefApp supports SecurityAccess (0x27). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>level1_Seed_requestSeed</td><td>0x01</td><td>Tbd</td><td>Extended, Programming</td></tr><tr><td>Level1_Seed_sendKey</td><td>0x02</td><td>Tbd</td><td>Extended, Programming</td></tr><tr><td>Level3_Seed_requestSeed</td><td>0x03</td><td>Tbd</td><td>Extended</td></tr><tr><td>Level3_Seed_sendKey</td><td>0x04</td><td>Tbd</td><td>Extended</td></tr></tbody></table><h3 id="communicationcontrol-0x28" tabindex="-1"><a class="header-anchor" href="#communicationcontrol-0x28" aria-hidden="true">#</a> CommunicationControl (0x28)</h3><p>RT_RefApp supports CommunicationControl (0x28). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>enableRxAndTx</td><td>0x00</td><td>Tbd</td><td>Extended, Programming</td></tr><tr><td>enableRxAndDisableTx</td><td>0x01</td><td>Tbd</td><td>Extended, Programming</td></tr><tr><td>disableRxAndEnableTx</td><td>0x02</td><td>Tbd</td><td>Extended, Programming</td></tr><tr><td>disableRxAndTx</td><td>0x03</td><td>Tbd</td><td>Extended, Programming</td></tr></tbody></table><h3 id="testerpresent-0x3e" tabindex="-1"><a class="header-anchor" href="#testerpresent-0x3e" aria-hidden="true">#</a> TesterPresent (0x3E)</h3><p>RT_RefApp supports TesterPresent (0x3E). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>zeroSubFunction</td><td>0x00</td><td>Tbd</td><td>Default, Extended</td></tr></tbody></table><h3 id="controldtcsetting-0x85" tabindex="-1"><a class="header-anchor" href="#controldtcsetting-0x85" aria-hidden="true">#</a> ControlDTCSetting (0x85)</h3><p>RT_RefApp supports ControlDTCSetting (0x85). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>on</td><td>0x01</td><td>Tbd</td><td>Extended, Programming</td></tr><tr><td>off</td><td>0x02</td><td>Tbd</td><td>Extended, Programming</td></tr></tbody></table><h3 id="responseonevent-0x86" tabindex="-1"><a class="header-anchor" href="#responseonevent-0x86" aria-hidden="true">#</a> ResponseOnEvent (0x86)</h3><p>RT_RefApp supports ResponseOnEvent (0x86). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>stopResponseOnEvent</td><td>0x00</td><td>Tbd</td><td>Default, Extended</td></tr><tr><td>startResponseOnEvent</td><td>0x05</td><td>Tbd</td><td>Default, Extended</td></tr></tbody></table><h3 id="readdatabyidentifier-0x22" tabindex="-1"><a class="header-anchor" href="#readdatabyidentifier-0x22" aria-hidden="true">#</a> ReadDataByIdentifier (0x22)</h3><p>RT_RefApp supports ReadDataByIdentifie (0x22). Supported Data Identifier for read :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>DcmDspDid_ActiveDiagnosticInformation</td><td>0xF186</td><td>Tbd</td><td>Default, Programming, Extended</td></tr><tr><td>DcmDspDid_NVM_TEST_BLOCK</td><td>0xF190</td><td>Tbd</td><td>Default, Programming, Extended</td></tr><tr><td>DcmDspDid_VersionInformation</td><td>0xF19A</td><td>Tbd</td><td>Default, Programming, Extended</td></tr></tbody></table><h3 id="writedatabyidentifier-0x2e" tabindex="-1"><a class="header-anchor" href="#writedatabyidentifier-0x2e" aria-hidden="true">#</a> WriteDataByIdentifier (0x2E)</h3><p>RT_RefApp supports WriteDataByIdentifier (0x2E). Supported Data Identifier for read :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>DcmDspDid_NVM_TEST_BLOCK</td><td>0xF190</td><td>Tbd</td><td>Default, Programming, Extended</td></tr></tbody></table><h3 id="cleardiagnosticinformation-0x14" tabindex="-1"><a class="header-anchor" href="#cleardiagnosticinformation-0x14" aria-hidden="true">#</a> ClearDiagnosticInformation (0x14)</h3><p>RT_RefApp supports ClearDiagnosticInformation (0x14). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>none</td><td>N/A</td><td>Tbd</td><td>Default, Extended</td></tr></tbody></table><h3 id="readdtcinformation-0x19" tabindex="-1"><a class="header-anchor" href="#readdtcinformation-0x19" aria-hidden="true">#</a> ReadDTCInformation (0x19)</h3><p>RT_RefApp supports ReadDTCInformation (0x19). Subservice configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>reportNumberOfDTCByStatusMask</td><td>0x01</td><td>Tbd</td><td>Default, Extended</td></tr><tr><td>reportDTCByStatusMask</td><td>0x02</td><td>Tbd</td><td>Default, Extended</td></tr><tr><td>reportDTCSnapshotRecordByDTCNumber</td><td>0x04</td><td>Tbd</td><td>Default, Extended</td></tr><tr><td>reportDTCExtDataRecordByDTCNumber</td><td>0x06</td><td>Tbd</td><td>Default, Extended</td></tr><tr><td>reportSupportedDTC</td><td>0x0A</td><td>Tbd</td><td>Default, Extended</td></tr><tr><td>reportDTCFaultDetectionCounter</td><td>0x14</td><td>Tbd</td><td>Default, Extended</td></tr><tr><td>reportUserDefMemoryDTCByStatusMask</td><td>0x17</td><td>Tbd</td><td>Default, Extended, Programming</td></tr><tr><td>reportUserDefMemoryDTCSnapshotRecordByDTCNumber</td><td>0x18</td><td>Tbd</td><td>Default, Extended, Programming</td></tr><tr><td>reportUserDefMemoryDTCExtDataRecordByDTCNumber</td><td>0x19</td><td>Tbd</td><td>Default, Extended, Programming</td></tr></tbody></table><h3 id="routinecontrol-0x31" tabindex="-1"><a class="header-anchor" href="#routinecontrol-0x31" aria-hidden="true">#</a> RoutineControl (0x31)</h3><p>RT_RefApp supports RoutineControl (0x31). Service configuration :</p><table><thead><tr><th>Name</th><th>ID</th><th>Security</th><th>Session</th></tr></thead><tbody><tr><td>DIAGNOSTIC_LOOPBACK</td><td>0x0100</td><td>Tbd</td><td>Extended</td></tr><tr><td>DIAGNOSTIC_TRIGGER_DTC</td><td>0x0101</td><td>Tbd</td><td>Extended</td></tr></tbody></table>',44),i={render:function(t,e){return r}}}}]);